import React from 'react';
import Media from 'react-media';
import { useNavigate } from 'react-router-dom';
import { FcKey } from 'react-icons/fc';

// This is Name view 
export default function ReturnPinSetting() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenLarge />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => {

 const navigation = useNavigate();
 const handlepath = (event) => {
  event.preventDefault();
  navigation('/pin/now');
 }

 return (
  <div onClick={handlepath} className='wrp-name-profil cursor-pin'>

   <div className='wrp-boxname-profil'>
    <FcKey size={'2em'} color={'red'} />

    <div className='profil-name-identity'>
     <h1>Modifier Pin</h1>
     <ReturnPeople />
     <ViewText />
    </div>

   </div>
  </div>
 );
};
export const ViewText = () => (
 <p>
  Modifier (PIN) utilisateur du compte MuunganoMoney.
 </p>
);
export const ReturnPeople = () => {
 return (
  <h2>**********</h2>
 );
};
